import React from "react";
import { Form, Input, Select, Row, Col, Button } from 'antd';
const { Option } = Select;
export default function JobInfo() {

    const onFinish = values => {
        console.log('Received values of form: ', values);
      };

    return (
        <>
            <Form name="complex-form" onFinish={onFinish} >
                <Row gutter={24}>
                    <Col span={12}>
                        <Form.Item
                            name="job_name"
                            label="Job name"
                            rules={[
                            {
                                required: true,
                                message: 'Input something!',
                            },
                            ]}
                        >
                            <Input placeholder="Job name" />
                        </Form.Item>
                    </Col>
                    <Col span={12}>
                        <Form.Item
                            name="pad_name"
                            label="Pad name"
                            rules={[
                            {
                                required: true,
                                message: 'Input something!',
                            },
                            ]}
                        >
                            <Input placeholder="Pad name" />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={24}>
                    <Col span={12}>
                        <Form.Item
                            name="job_type"
                            label="Job type"
                            rules={[
                            {
                                required: true,
                                message: 'Input something!',
                            },
                            ]}
                        >
                            <Input placeholder="Job type" />
                        </Form.Item>
                    </Col>
                    <Col span={12}>
                        <Form.Item
                            name="pad_id"
                            label="Pad Id"
                            rules={[
                            {
                                required: true,
                                message: 'Input something!',
                            },
                            ]}
                        >
                            <Input placeholder="Pad id" />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={24}>
                    <Col span={12}>
                        <Form.Item
                            name="job_id"
                            label="Job id"
                            rules={[
                            {
                                required: true,
                                message: 'Input something!',
                            },
                            ]}
                        >
                            <Input placeholder="Job id" />
                        </Form.Item>
                    </Col>
                    <Col span={12}>
                        <Form.Item
                            name="client_name"
                            label="Client name"
                            rules={[
                            {
                                required: true,
                                message: 'Input something!',
                            },
                            ]}
                        >
                            <Input placeholder="Client name" />
                        </Form.Item>
                    </Col>
                </Row>


                <Form.Item label=" " colon={false}>
                    <Button type="primary" htmlType="submit">
                    Submit
                    </Button>
                </Form.Item>
            </Form>
        </>
    );
}
